description:
&quot;For the record&quot; 

Het gaat hier om exclusieve en zeer persoonlijke beelden waarin Britney achter de schermen wordt gevolgd naar opnamestudio's, repetities, persconferenties en naar haar woonplaats Louisiana. Ook wordt zonder enige restrictie openhartig gesproken over de problemen waar zij de afgelopen jaren mee kampte en over haar aankomende comeback.

Elke stap en vooral elke misstap van Britney Spears kunnen we dagelijks via de media vernemen. Maar nu vindt zij dat het tijd is om haar kant van het verhaal te laten zien: &quot;Ik wilde deze documentaire maken omdat ik vond dat ik werd bezien in een licht waarin ik niet bezien wilde worden. Ik zie dit als een kans om alles recht te zetten en te vertellen waar ik doorheen ben gegaan en waar ik nu naartoe wil.&quot; De zangeres praat ook over de fouten die de hele wereld haar zag begaan en hoe ze daar nu over terugdenkt: &quot;Nu ik hier zit en terugblik, vraag ik me af: I'm a smart person, what the hell was I thinking?&quot;

De documentaire wordt ingeleid en afgesloten door Winston Gerschtanowitz en Albert Verlinde.
